import React from "react";
import Row from "./Row";

function Table({ rows, tableHeader }) {
  return (
    <table>
      <thead>
        <tr>{tableHeader}</tr>
      </thead>
      <tbody>
        {rows.map((row) => (
          <Row key={row.id} row={row} />
        ))}
      </tbody>
    </table>
  );
}

export default Table;
